', 49400, 'Полювання в 45км від Києва - це мисливське господарство «Трипільське мисливець».
На території в 50 тисяч гектар проводиться колективне та індивідуальне полювання на трофейного кабана і європейську козулю, полювання на польову і водоплавну дичину, на хутрових звірів. Натаска собак на кабана у вольєрі.
На території «Трипільського мисливця» розташований мисливський будиночок зі зручностями, кухнею і обіднім залом.', 1);
