', 6763.6, 'Отримайте унікальний досвід полювання в екологічному господарстві, пересування по якому здійснюється виключно на гужовому транспорті!
Мисливське господарство «Мисливці Полісся» розташоване в 200 км від Києва, займає площу в 6700га лісових, польових і водно-болотних угідь.
Проводиться індивідуальне (в тому числі і з вишки) і колективне полювання на трофейного лося, кабана, косулю, хутрових звірів та пернату дичину, рибалка з вимостків - ставок 16га (сом, судак, щука, окунь, короп, лин, червоний карась).', 26);
